import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  const [data, setData] = React.useState({});

  React.useEffect(() => {
    fetch("/players")
      .then((response) => response.json())
      .then((data) => setData(data))
  }, []);

  console.log(data);

  return (
    <div className="App">
      <header className="App-header">
        {/* <p>{!data ? "Loading..." : data}</p> */}
        <p>{data.name}</p>
      </header>
    </div>
  );
}

export default App;
